import "./App.css";
import Container from "./Container/Container";
 import {Switch, Route} from "react-router-dom";
 import Signup from "./Component/Signup";
 import Signin from "./Component/Signin";

function App() {
  return (
    <div>
       <Switch>
        <Route path='/'><Signup/> </Route>
      </Switch>   
    </div>
  );
}

export default App;
